import './App.css';
import { Container, AppBar, Typography, Grow, Grid } from '@material-ui/core';
import memories from './'

function App() {
  return (
    <Container maxidth="lg">
      <AppBar position="static" color="inherit">
        <Typography variant="h2" align="center">Memories</Typography>
      </AppBar>
    </Container>
  );
}

export default App;
